('TeampleX - 팀플', '', 'admin', 'cs@dosrains.com', 'TeampleX - 팀플', '', 1, 0, 1, 0, 100, 15, 60, 'theme_basic_new', 15, 'theme_basic_new', 'theme_basic_new', 'theme_basic_new', 0, 0, 0, 0, 10, 5, '_blank', 0, 30, '18아,18놈,18새끼,18뇬,18노,18것,18넘,개년,개놈,개뇬,개새,개색끼,개세끼,개세이,개쉐이,개쉑,개쉽,개시키,개자식,개좆,게색기,게색끼,광뇬,뇬,눈깔,뉘미럴,니귀미,니기미,니미,도촬,되질래,뒈져라,뒈진다,디져라,디진다,디질래,병쉰,병신,뻐큐,뻑큐,뽁큐,삐리넷,새꺄,쉬발,쉬밸,쉬팔,쉽알,스패킹,스팽,시벌,시부랄,시부럴,시부리,시불,시브랄,시팍,시팔,시펄,실밸,십8,십쌔,십창,싶알,쌉년,썅놈,쌔끼,쌩쑈,썅,써벌,썩을년,쎄꺄,쎄엑,쓰바,쓰발,쓰벌,쓰팔,씨8,씨댕,씨바,씨발,씨뱅,씨봉알,씨부랄,씨부럴,씨부렁,씨부리,씨불,씨브랄,씨빠,씨빨,씨뽀랄,씨팍,씨팔,씨펄,씹,아가리,아갈이,엄창,접년,잡놈,재랄,저주글,조까,조빠,조쟁이,조지냐,조진다,조질래,존나,존니,좀물,좁년,좃,좆,좇,쥐랄,쥐롤,쥬디,지랄,지럴,지롤,지미랄,쫍빱,凸,퍽큐,뻑큐,빠큐,ㅅㅂㄹㅁ', '', '', '', '', '', '', 'theme_basic_new', 0, 0, 0, 0, 1, 0, 0, 0, 1, 0, 0, 0, 2, 1000, 2, 0, 0, 30, 10000, 1, 0, 0, 0, 0, 0, 0, 0, 0, 'admin,administrator,관리자,운영자,어드민,주인장,webmaster,웹마스터,sysop,시삽,시샵,manager,매니저,메니저,root,루트,su,guest,방문객', '', 30, 180, 180, 180, '2025-08-08', 2, 5000, 22, 22, 50000, 60, 60, 10, 'gif|jpg|jpeg|png', 'swf', 'asx|asf|wmv|wma|mpg|mpeg|mov|avi|mp3', 1, 15, 15, '오늘:1,어제:,최대:6,전체:81', 0, '제1조 (목적)\r\n본 약관은 [팀플엑스] (이하 \"회사\")가 제공하는 축구 팀 관리 플랫폼(이하 \"서비스\")의 이용과 관련하여 회사와 이용자 간의 권리, 의무 및 책임사항을 규정함을 목적으로 합니다.\r\n\r\n제2조 (정의)\r\n\r\n\"이용자\"란 본 약관에 따라 회사가 제공하는 서비스를 이용하는 자를 말합니다.\r\n\r\n\"회원\"이란 회사에 개인정보를 제공하고 회원가입을 완료하여, 서비스 이용 자격을 부여받은 자를 말합니다.\r\n\r\n\"팀 관리자\"란 팀을 생성하고 일정, 팀원, 회비 등의 팀 운영 정보를 관리할 수 있는 회원을 의미합니다.\r\n\r\n\"팀원\"이란 팀 관리자 또는 초대를 통해 특정 팀에 가입한 회원을 의미합니다.\r\n\r\n제3조 (약관의 효력 및 변경)\r\n\r\n본 약관은 서비스 초기화면 또는 회사가 지정하는 방법으로 게시하여 이용자에게 공지함으로써 효력을 발생합니다.\r\n\r\n회사는 관련 법령을 위반하지 않는 범위 내에서 약관을 변경할 수 있으며, 변경된 약관은 공지한 날로부터 7일 후부터 효력이 발생합니다.\r\n\r\n제4조 (제공하는 서비스)\r\n회사는 이용자에게 다음 각 호의 서비스를 제공합니다.\r\n\r\n회원가입 및 계정 관리 서비스\r\n\r\n팀 생성 및 가입 서비스\r\n\r\n팀별 일정 등록, 수정, 삭제 기능\r\n\r\n일정별 참석 여부 확인 및 관리 기능\r\n\r\n팀 회비 납부 내역 등록 및 관리 기능\r\n\r\n기타 회사가 정하는 서비스\r\n\r\n제5조 (회원가입)\r\n\r\n회원가입은 이용자가 약관에 동의하고 회사가 정한 절차에 따라 가입 신청을 완료함으로써 이루어집니다.\r\n\r\n회사는 다음 각 호에 해당하는 경우 회원가입을 거부하거나 사후에 취소할 수 있습니다.\r\n\r\n타인의 명의를 도용한 경우\r\n\r\n허위 정보를 기재한 경우\r\n\r\n기타 회사가 부적절하다고 판단하는 경우\r\n\r\n제6조 (이용자의 의무)\r\n\r\n이용자는 관계법령, 본 약관, 회사의 공지사항을 준수해야 합니다.\r\n\r\n이용자는 다음 행위를 하여서는 안 됩니다.\r\n\r\n타인의 정보 도용\r\n\r\n타인을 비방하거나 명예를 훼손하는 행위\r\n\r\n플랫폼의 정상적인 운영을 방해하는 행위\r\n\r\n기타 사회통념상 부적절하다고 판단되는 행위\r\n\r\n제7조 (서비스의 변경 및 중단)\r\n\r\n회사는 서비스의 향상이나 시스템 점검, 기타 운영상 필요한 경우 서비스를 변경하거나 일시적으로 중단할 수 있습니다.\r\n\r\n서비스의 영구적인 중단 시 회사는 사전 고지 후 종료할 수 있습니다.\r\n\r\n제8조 (회비 및 정산 관련 책임)\r\n\r\n회비 등록 및 납부 내역 관리는 팀 관리자 및 팀원 간의 책임 하에 이루어지며, 회사는 실제 금전 거래에 관여하지 않습니다.\r\n\r\n회사는 회비 관련한 분쟁 발생 시 책임을 지지 않으며, 해당 팀 내부에서 해결해야 합니다.\r\n\r\n제9조 (개인정보 보호)\r\n회사는 이용자의 개인정보를 관련 법령에 따라 보호하며, 자세한 내용은 개인정보처리방침을 따릅니다.\r\n\r\n제10조 (저작권 및 게시물 관리)\r\n\r\n이용자가 서비스 내에 게시한 내용의 저작권은 해당 이용자에게 있으며, 회사는 서비스 운영을 위한 범위 내에서 이를 사용할 수 있습니다.\r\n\r\n회사는 게시물이 관련 법령 또는 약관에 위배된다고 판단되는 경우 사전 통지 없이 삭제할 수 있습니다.\r\n\r\n제11조 (면책조항)\r\n\r\n회사는 천재지변, 시스템 오류, 네트워크 장애 등 불가항력적 사유로 인한 서비스 이용 장애에 대해 책임을 지지 않습니다.\r\n\r\n회사는 이용자 간의 분쟁에 개입하지 않으며, 어떠한 책임도 지지 않습니다.\r\n\r\n제12조 (분쟁 해결 및 관할법원)\r\n본 약관에 따라 발생한 분쟁은 회사의 본사 소재지를 관할하는 법원을 제1심 관할법원으로 하며, 대한민국 법률을 준거법으로 합니다.\r\n\r\n[부칙]\r\n본 약관은 2025년 3월 25일부터 시행합니다.', '제1조 (개인정보의 처리 목적)\r\n팀플엑스 (\'sweb.kr\' 이하 \'회사\')은(는) 다음의 목적을 위하여 개인정보를 처리합니다. 처리하고 있는 개인정보는 다음의 목적 이외의 용도로는 이용되지 않으며 이용 목적이 변경되는 경우에는 개인정보 보호법 제18조에 따라 별도의 동의를 받는 등 필요한 조치를 이행할 예정입니다.\r\n\r\n회원 가입 및 관리\r\n\r\n회원 가입의사 확인, 회원제 서비스 제공에 따른 본인 식별·인증, 회원자격 유지·관리, 서비스 부정이용 방지, 각종 고지·통지 등을 목적으로 개인정보를 처리합니다.\r\n\r\n\r\n서비스 제공\r\n\r\n팀 생성 및 가입, 일정 관리, 참석 여부 관리, 회비 관리 등 서비스 제공과 관련한 목적으로 개인정보를 처리합니다.\r\n\r\n\r\n마케팅 및 광고에의 활용 (선택적 수집 항목)\r\n\r\n신규 서비스(제품) 개발 및 맞춤 서비스 제공, 이벤트 및 광고성 정보 제공 및 참여기회 제공, 서비스의 유효성 확인, 접속빈도 파악 또는 회원의 서비스 이용에 대한 통계 등을 목적으로 개인정보를 처리합니다.\r\n\r\n\r\n\r\n제2조 (개인정보의 처리 및 보유 기간)\r\n① 회사는 법령에 따른 개인정보 보유·이용기간 또는 정보주체로부터 개인정보를 수집 시에 동의받은 개인정보 보유·이용기간 내에서 개인정보를 처리·보유합니다.\r\n② 각각의 개인정보 처리 및 보유 기간은 다음과 같습니다.\r\n\r\n회원 가입 및 관리: 회원 탈퇴 시까지\r\n\r\n다만, 다음의 사유에 해당하는 경우에는 해당 사유 종료 시까지\r\n\r\n관계 법령 위반에 따른 수사·조사 등이 진행 중인 경우에는 해당 수사·조사 종료 시까지\r\n서비스 이용에 따른 채권·채무관계가 잔존하는 경우에는 해당 채권·채무관계 정산 시까지\r\n\r\n\r\n\r\n\r\n\r\n제3조 (처리하는 개인정보의 항목)\r\n회사는 다음의 개인정보 항목을 처리하고 있습니다.\r\n\r\n회원 가입 및 관리\r\n\r\n필수항목: 이메일 주소, 비밀번호, 이름(닉네임), 휴대전화번호\r\n선택항목: 프로필 이미지, 생년월일, 주소\r\n\r\n\r\n서비스 이용 과정에서 생성되는 정보\r\n\r\nIP 주소, 쿠키, 방문 일시, 서비스 이용 기록, 기기정보\r\n\r\n\r\n팀 관리 및 일정 관리 서비스 이용 시\r\n\r\n팀명, 팀원 목록, 일정 정보, 참석 여부, 회비 납부 정보\r\n\r\n\r\n\r\n제4조 (개인정보의 제3자 제공)\r\n① 회사는 원칙적으로 정보주체의 개인정보를 제1조(개인정보의 처리 목적)에서 명시한 범위 내에서만 처리하며, 정보주체의 동의, 법률의 특별한 규정 등 개인정보 보호법 제17조 및 제18조에 해당하는 경우에만 개인정보를 제3자에게 제공합니다.\r\n② 현재 회사는 개인정보를 제3자에게 제공하고 있지 않습니다. 향후 제3자 제공이 필요한 경우, 사전에 정보주체의 동의를 구할 것입니다.\r\n제5조 (개인정보처리 위탁)\r\n회사는 현재 개인정보 처리업무를 외부 업체에 위탁하고 있지 않습니다. 향후 서비스 향상을 위해 개인정보 처리업무 위탁이 필요한 경우, 위탁 업무의 내용과 수탁자를 명확히 알리고 필요한 조치를 이행할 예정입니다.\r\n제6조 (정보주체와 법정대리인의 권리·의무 및 그 행사방법)\r\n① 정보주체는 회사에 대해 언제든지 개인정보 열람·정정·삭제·처리정지 요구 등의 권리를 행사할 수 있습니다.\r\n② 제1항에 따른 권리 행사는 회사에 대해 개인정보 보호법 시행령 제41조제1항에 따라 서면, 전자우편, 모사전송(FAX) 등을 통하여 하실 수 있으며 회사는 이에 대해 지체 없이 조치하겠습니다.\r\n③ 제1항에 따른 권리 행사는 정보주체의 법정대리인이나 위임을 받은 자 등 대리인을 통하여 하실 수 있습니다. 이 경우 \"개인정보 처리 방법에 관한 고시(제2020-7호)\" 별지 제11호 서식에 따른 위임장을 제출하셔야 합니다.\r\n④ 개인정보 열람 및 처리정지 요구는 개인정보보호법 제35조 제4항, 제37조 제2항에 의하여 정보주체의 권리가 제한될 수 있습니다.\r\n⑤ 개인정보의 정정 및 삭제 요구는 다른 법령에서 그 개인정보가 수집 대상으로 명시되어 있는 경우에는 그 삭제를 요구할 수 없습니다.\r\n⑥ 회사는 정보주체 권리에 따른 열람의 요구, 정정·삭제의 요구, 처리정지의 요구 시 열람 등 요구를 한 자가 본인이거나 정당한 대리인인지를 확인합니다.\r\n제7조 (개인정보의 안전성 확보조치)\r\n회사는 개인정보의 안전성 확보를 위해 다음과 같은 조치를 취하고 있습니다.\r\n\r\n관리적 조치: 내부관리계획 수립·시행, 정기적인 직원 교육\r\n기술적 조치: 개인정보처리시스템 등의 접근권한 관리, 접근통제시스템 설치, 고유식별정보 등의 암호화, 보안프로그램 설치\r\n물리적 조치: 전산실, 자료보관실 등의 접근통제\r\n\r\n제8조 (개인정보 자동 수집 장치의 설치·운영 및 거부에 관한 사항)\r\n① 회사는 이용자에게 개별적인 맞춤서비스를 제공하기 위해 이용정보를 저장하고 수시로 불러오는 \'쿠키(cookie)\'를 사용합니다.\r\n② 쿠키는 웹사이트를 운영하는데 이용되는 서버(http)가 이용자의 컴퓨터 브라우저에게 보내는 소량의 정보이며 이용자들의 PC 컴퓨터내의 하드디스크에 저장되기도 합니다.\r\n\r\n쿠키의 사용 목적: 이용자가 방문한 각 서비스와 웹 사이트들에 대한 방문 및 이용형태, 인기 검색어, 보안접속 여부, 등을 파악하여 이용자에게 최적화된 정보 제공을 위해 사용됩니다.\r\n쿠키의 설치·운영 및 거부: 웹브라우저 상단의 도구>인터넷 옵션>개인정보 메뉴의 옵션 설정을 통해 쿠키 저장을 거부할 수 있습니다.\r\n쿠키 저장을 거부할 경우 맞춤형 서비스 이용에 어려움이 발생할 수 있습니다.\r\n\r\n제9조 (개인정보 보호책임자)\r\n① 회사는 개인정보 처리에 관한 업무를 총괄해서 책임지고, 개인정보 처리와 관련한 정보주체의 불만처리 및 피해구제 등을 위하여 아래와 같이 개인정보 보호책임자를 지정하고 있습니다.\r\n\r\n개인정보 보호책임자\r\n\r\n부서명: [운영부]\r\n담당자: [조덕환]\r\n연락처: [010-5029-0303], [cs@dosrains.com]\r\n\r\n\r\n\r\n② 정보주체께서는 회사의 서비스를 이용하시면서 발생한 모든 개인정보 보호 관련 문의, 불만처리, 피해구제 등에 관한 사항을 개인정보 보호책임자에게 문의하실 수 있습니다. 회사는 정보주체의 문의에 대해 지체 없이 답변 및 처리해드릴 것입니다.\r\n제10조 (개인정보 열람청구)\r\n정보주체는 개인정보 보호법 제35조에 따른 개인정보의 열람 청구를 아래의 부서에 할 수 있습니다. 회사는 정보주체의 개인정보 열람청구가 신속하게 처리되도록 노력하겠습니다.\r\n\r\n개인정보 열람청구 접수·처리 부서\r\n\r\n부서명: [운영부]\r\n담당자: [조덕환]\r\n연락처: [010-5029-0303], [cs@dosrains.com]\r\n\r\n\r\n\r\n제11조 (권익침해 구제방법)\r\n정보주체는 개인정보침해로 인한 구제를 받기 위하여 개인정보분쟁조정위원회, 한국인터넷진흥원 개인정보침해신고센터 등에 분쟁해결이나 상담 등을 신청할 수 있습니다. 이 밖에 기타 개인정보침해의 신고, 상담에 대하여는 아래의 기관에 문의하시기 바랍니다.\r\n\r\n개인정보분쟁조정위원회: 1833-6972 (www.kopico.go.kr)\r\n개인정보침해신고센터: (국번없이) 118 (privacy.kisa.or.kr)\r\n대검찰청: (국번없이) 1301 (www.spo.go.kr)\r\n경찰청: (국번없이) 182 (ecrm.cyber.go.kr)\r\n\r\n제12조 (개인정보 처리방침 변경)\r\n① 이 개인정보처리방침은 [2025년 3월 25]부터 적용됩니다.', 0, 500, 'theme_basic_new', 'theme_basic_new', 'theme_basic_new', 'theme_basic_new', 'theme_basic_new', 'basic', 'smarteditor2', 0, '', '', '', '', '', '', 2, 0, '', '', '', '', '211.172.232.124', '7295', '', '', 1, 'kakao', '', '', '', '', '', '', '', '', '', '', '', '', '', 'kcaptcha', '', '', '사이트 이름', '사이트 주소', '저작권 명시', 'Keywords', 'Description', '대표자', '사업자 등록 번호', '대표 전화', '팩스', '이메일', '사이트 이름', '사이트 주소', 'Copyright (c) 2010', '사이트 키워드들', '사이트에 대한 설명', '대표자', '사업자 등록 번호', '대표 전화', '팩스', '이메일');
